          "id": "N__26526161",
          "name": "Royal Botanic Garden",
          "score": 9.95716992326547,
          "intro": "The Royal Botanic Garden, Sydney is a heritage-listed major 30ha botanical garden, event venue and public recreation area located at Farm Cove on the eastern fringe of the Sydney central business district, in the City of Sydney local government area of New South Wales, Australia.\nOpened in 1816, the garden is the oldest scientific institution in Australia and one of the most important historic botanical institutions in the world. The overall structure and key elements were designed by Charles Moore and Joseph Maiden, and various other elements designed and built under the supervision of Allan Cunningham, Richard Cunningham, and Carrick Chambers. The garden is owned by the Government of New South Wales and administered by the Royal Botanic Gardens and Domain Trust. The Botanic Garden, together with the adjacent Domain were added to the New South Wales State Heritage Register on 2 April 1999.\nThe Garden and The Domain are open every day of the year and access is free. Its stunning position on Sydney Harbour, the Sydney Opera House and the large public parklands of The Domain ensure it is one of the most visited attractions in Sydney. The garden is bordered by the Cahill Expressway to the south and west, Macquarie Street to the northwest, Art Gallery Road to the east, and Sydney Harbour to the north.",
